            "690340408": {
                "Next": [
                    690340409,
                    690340410
                ],
                "Type": 1,
                "Text": "Das wäre gewiss ein wundervolles, bedeutsames Ereignis ..."
            },
            "690340409": {
                "Next": [
                    690340411
                ],
                "Type": 0,
                "Text": "Nun, wenn du darauf bestehst ... Herzlichen Dank!"
            },
            "690340410": {
                "Next": [
                    690340411
                ],
                "Type": 0,
                "Text": "Ich bringe dir auf jeden Fall etwas im Gegenzug."
            },
            "690340411": {
                "Next": [
                    690340412
                ],
                "Type": 1,
                "Text": "Ja ... vollkommen."
            },
            "690340412": {
                "Next": [
                    690340413
                ],
                "Type": 1,
                "Text": "Und jetzt ist wieder Zeit, um fleißig zu sein!"
            },
            "690340413": {
                "Next": [],
                "Type": 1,
                "Text": "Nur, dass das wohl die schönste Arbeit in ganz Teyvat ist."
            },
            "690340801": {
                "Next": [
                    690340401
                ],
                "Type": 0,
                "Text": "Gibt es etwas, das du machen willst?"
            },
            "690340301": {
                "Next": [
                    690340209
                ],
                "Type": 0,
                "Text": "Möchtest du mit mir reden?"
            },
            "690340302": {
                "Next": [
                    690340303
                ],
                "Type": 1,
                "Text": "Weißt du was? Seit ich hier bin, konnte ich kein einziges verlorenes Ding mehr auftreiben."
            },
            "690340303": {
                "Next": [
                    690340304,
                    690340306
                ],
                "Type": 1,
                "Text": "Ich bin das noch nicht gewöhnt ..."
            },
            "690340304": {
                "Next": [
                    690340305
                ],
                "Type": 0,
                "Text": "Hä?"
            },
            "690340305": {
                "Next": [
                    690340308
                ],
                "Type": 1,
                "Text": "Was ich damit sagen will, ist, dass ich bei meinen Reinigungsarbeiten häufig Krimskrams gefunden habe."
            },
            "690340306": {
                "Next": [
                    690340307
                ],
                "Type": 0,
                "Text": "Du läufst also herum und sammelst zufällig verlorene Gegenstände ein?"
            },
            "690340307": {
                "Next": [
                    690340308
                ],
                "Type": 1,
                "Text": "Nein, das sind nur Sachen, die ich beim Putzen finde ..."
            },
            "690340308": {
                "Next": [
                    690340309
                ],
                "Type": 1,
                "Text": "Zum Beispiel ... ein verblasster Haarreif unter einem Schrank."
            },
            "690340309": {
                "Next": [
                    690340310
                ],
                "Type": 1,
                "Text": "Oder ein Ball, der von einem Kätzchen in einem Gebüsch versteckt wurde."
            },
            "690340310": {
                "Next": [
                    690340311,
                    690340313
                ],
                "Type": 1,
                "Text": "Oder ein Lesezeichen in einer Ecke der Bibliothek, ein am Wegesrand verlorener Schlüssel, ein anonymes Beichtschreiben, das in der Kirchentür steckt ..."
            },
            "690340311": {
                "Next": [
                    690340312
                ],
                "Type": 0,
                "Text": "Das hört sich an, als wäre das Putzen ziemlich mühselig ..."
            },
            "690340312": {
                "Next": [
                    690340315
                ],
                "Type": 1,
                "Text": "Nein, ganz und gar nicht! Es ist mir eine große Ehre, meine Pflichten zu erfüllen."
            },
            "690340313": {
                "Next": [
                    690340314
                ],
                "Type": 0,
                "Text": "Wo gelangen all diese Dinge hin?"
            },
            "690340314": {
                "Next": [
                    690340315
                ],
                "Type": 1,
                "Text": "Ich bemühe mich immer sehr, jedes Stück wieder mit seinem Besitzer zu vereinen! Aber jene Gegenstände, die nicht abgeholt werden, verbleiben im Hauptquartier der Ritter des Ordo Favonius."
            },
            "690340315": {
                "Next": [
                    690340316
                ],
                "Type": 1,
                "Text": "Da wir gerade vom Putzen sprechen ..."
            },
            "690340316": {
                "Next": [
                    690340317
                ],
                "Type": 1,
                "Text": "Dieser Ort sieht immer so sauber und aufgeräumt aus."
            },
            "690340317": {
                "Next": [
                    690340318
                ],
                "Type": 0,
                "Text": "Dies ist nicht zuletzt dein Verdienst."
            },
            "690340701": {
                "Next": [
                    690340301
                ],
                "Type": 0,
                "Text": "Möchtest du mit mir reden?"
            },
            "690340318": {
                "Next": [
                    690340319
                ],
                "Type": 1,
                "Text": "Danke ..."
            },
            "690340319": {
                "Next": [
                    690340320
                ],
                "Type": 1,
                "Text": "Es ist stets eine große Freude, hier zu arbeiten! Noch mehr, als wenn ich für die Ritter oder irgendwo anders putze."
            },
            "690340320": {
                "Next": [],
                "Type": 1,
                "Text": "Weil ... das dein Zuhause ist."
            },
            "690340202": {
                "Next": [
                    690340203
                ],
                "Type": 1,
                "Text": "Ich liebe die Atmosphäre hier, wie man es sicher erwarten würde."
            },
            "690340203": {
                "Next": [
                    690340204
                ],
                "Type": 1,
                "Text": "Es ist hier sehr weitläufig und ansprechend, das Innere ist hervorragend dekoriert."
            },
            "690340204": {
                "Next": [
                    690340205
                ],
                "Type": 1,
                "Text": "Ich finde, das ist das schönste Anwesen, das ich je gesehen habe!"
            },
            "690340205": {
                "Next": [
                    690340206
                ],
                "Type": 1,
                "Text": "Das einzige Problem ist ..."
            },
            "690340206": {
                "Next": [
                    690340207
                ],
                "Type": 0,
                "Text": "Problem? Was für ein Problem?"
            },
            "690340207": {
                "Next": [
                    690340208
                ],
                "Type": 1,
                "Text": "Im Gegensatz zu Mondstadt gibt es hier zu wenig für eine Magd zu tun."
            },
            "690340208": {
                "Next": [],
                "Type": 1,
                "Text": "Es fühlt sich ein wenig zu gemütlich an."
            },
            "690340209": {
                "Next": [
                    690340302
                ],
                "Type": 1,
                "Text": "Das wäre mir ein Vergnügen!"
            },
            "690340601": {
                "Next": [
                    690340602
                ],
                "Type": 0,
                "Text": "Gute Nacht, Noelle."
            },
            "690340602": {
                "Next": [
                    690340603
                ],
                "Type": 1,
                "Text": "Gute Nacht, {NICKNAME}."
            },
            "690340603": {
                "Next": [],
                "Type": 1,
                "Text": "Wenn du ein Glas heiße Milch oder ein Schlaflied brauchst, kümmere ich mich sofort darum."
            }
